morphometric variation across all specimens combined. Dorsal profile steep: straight, convex, or slightly concave from tip of snout to occiput, slightly concave at occiput, convex or straight from occiput to dorsal fin origin, and convex behind dorsal fin origin to base of last dorsal ray, then horizontal to caudal fin base. Ventral profile slightly convex and downward angled on underside of head, convex from pelvic fin origin to below last dorsal fin ray, and horizontal to caudal fin base. Lateral line continuous from behind head to base of caudal fin, and approximately parallel with dorsal profile. Body depth at dorsal fin origin 36.6 (32.6–44.7) % SL; body depth at anal fin origin 32.7 (28.5–44.3) % SL; caudal peduncle length 16.6 (14.7–18.4) % SL; caudal peduncle depth 12.3 (11.3–14.0) % SL; pre-anus length 67 (62.2–72.3) % SL. Head length 29.6 (23.8–33.5) % SL; head pointed; snout length 39.8 (33.7–43.0) % HL; upper-jaw length 30.3 (26.4–33.9) % HL; jaws equal throughout development; jaw width 30.9 (23.8–35.0) % HL. Mouth terminal, horizontal or slightly angled upwards in lateral profile. Outer row of large teeth of same size with 2–4 rows of smaller teeth on both jaws, embedded in a jelly-like gum; tooth size decreasing from outer row to inner rows. Teeth on outer row of upper jaw 59 (31–79), number varying with size, 6 (3.8–7.3) / mm when standardised with upper jaw length; 4 (3–4) teeth rows behind outer row; teeth on outer row of lower jaw 55 (28–72), number varying with size, 4.5 (3.1–7.4) / mm when standardised with upper jaw length; 3 (2–3) tooth rows behind outer row. Teeth laterally compressed, broad and large relative to 

Syncomistes

, asymmetric shape, margins convex posteriorly and straight to slightly concave anteriorly, widest point closest to mid-point of tooth, apical region tapered to slight point, teeth fitted close together with some overlap (Tooth Morphotype 1; 
Fig. 6a
), laterally pointed in lower jaw, but not extending beyond outer lip. Toothless medial hump present on dorsal surface at symphysis of lower jaw, opposite toothless region of upper jaw in some specimens. Lower jaw U-shaped in juveniles and adults when viewed from below (Morphotype 1; 
Fig. 5a
). Upper jaw usually with fleshy, narrow, lip fold that is mostly discontinuous across the ventral midline, but occasionally continuous. Orbital diameter 21.4 (16.6–28.7) % HL; inter-orbital width 33.7 (26.8–38.2) % HL; post-orbital length 42.2 (40.2–46.8) % HL. Interorbital smooth, with bony ridge above each orbit. Parietal and supracleithrum sometimes serrated. Lower opercular spine longer and more robust than upper opercular spine, sometimes extending beyond edge of opercular membrane; preopercular spines serrate, longest and most robust on apex of preopercle, reduced in size dorsally and anteriorly, anteriormost spine situated behind posterior edge of orbit. Intestinal pattern of adults highly convoluted; large amount of looping to left of stomach; juveniles with less convoluted pattern.

Distribution: See Fig. 9 . Found throughout all surveyed catchments from the Drysdale River in the northern Kimberley (
Western Australia
) to the Finnis River (
Northern Territory
). A number of rivers remain unsurveyed within its range (notably the Berkley and Forrest rivers) where its presence has not been confirmed.
